import React, {useState} from 'react';
import Axios from 'axios';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';


import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import './card.css';

const LandingPage= (props)=> {
      const [roomId, setRoom] = useState('');
      const createroom = ()=> {
        Axios.get('http://localhost:5000/',{
          cors: {
            origin: "http://localhost:3000",
            methods: ["GET", "POST"]
          }
        }).then((res) =>{
          setRoom(res.data.link);
          
      });
        };
      
      const handlejoin=()=>{
        if(roomId)
        {
          props.history.push(`/${roomId}`);
        }
       
      }
      
     

      return (<React.Fragment><div class="outer">
      <div class="middle">
        <div class="inner">
        <Card className="center card">
      <CardContent align="center">
      <Grid container spacing={2} >
  <Grid container item xs={6} direction="column" >
    <TextField />
    <TextField />
    <TextField />
  </Grid>
  <Grid container item xs={6} direction="column" >
    <TextField />
    <TextField />
  </Grid>
</Grid>
      <div><Button variant="contained" color="primary"  onClick={createroom}> Create Room</Button>
      
      
      <TextField variant="outlined" color="white" type="text"  value={roomId} onChange={(e) =>{setRoom(e.target.value) }}/>
     </div>
     
      
      
      <div><Button variant="contained" color="primary" onClick={handlejoin} > Join Room</Button></div> 
      
      
      </CardContent>
      </Card>
        </div>
      </div>
    </div>
     
     
     
      </React.Fragment>
      )
};

export default LandingPage;
